	public static Set<Triple<String,Interval,String>> people(){
		Set<Triple<String,Interval,String>> res = new HashSet<Triple<String, Interval,String>>();
		String[] lines = genea.split("\n");
		String[] keys = lines[0].split("\\|");
		System.out.println(" number of fields "+keys.length);
		for (String line : lines){
			String[] values = line.split("\\|");
			//System.out.println(line+"  ->  "+  Arrays.toString(values)+"  ");
			System.out.println(values.length);
			Map<String,String> person = new HashMap<String,String>();
			for (int i = 0; i < keys.length ; i++){
				if (i < values.length) {
					person.put(keys[i], values[i]);
				}
			}
			//System.out.println("==================================\n" );
			//showOne(person);
			Triple<String, Interval, String> elt = convert(person, line);
			if (elt != null) res.add(elt);
		}	
		return res;
	}


	private static Triple<String, Interval, String> convert(Map<String, String> person, String entry) {
		String birth = person.get("year birth");
		String death = person.get("year death");
		System.out.println(person.get("year birth")+"    " + person.get("year death"));
		if (birth != null && !birth.equals("") && !birth.contains("year")){
			int birthYear = Integer.parseInt(birth);
			Date start = DateUtils.fromYear(birth);
			Date end = DateUtils.fromYear((birthYear+1)+"");
			if (death != null && !death.equals("") && !death.contains("year")){
				DateUtils.fromYear(death);
			}
			Interval interval = new Interval(start, end);
			String loc = "";
			loc += (person.get("address birth").equals("address birth")?"":person.get("address birth")+", ");
			loc += (person.get("city birth").equals("city birth")?"":person.get("city birth")+", ");
			loc += (person.get("country birth").equals("country birth")?"":person.get("country birth"));
			return new Triple(loc, interval,entry);
		}	
		return null;
	}

	public static void showOne(Map<String,String> person){
		for (String k : person.keySet()){
			if (!k.equals(person.get(k))){
				System.out.println( "    "+k +" : "+ person.get(k));
			}
		}
	}
